/*Table structure for table `password_resets` */

DROP TABLE IF EXISTS `password_resets`;

CREATE TABLE `password_resets` (
  `email` varchar(191) COLLATE utf8mb4_unicode_ci NOT NULL,
  `token` varchar(191) COLLATE utf8mb4_unicode_ci NOT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  KEY `password_resets_email_index` (`email`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

/*Data for the table `password_resets` */

/*Table structure for table `persona` */

DROP TABLE IF EXISTS `persona`;

CREATE TABLE `persona` (
  `idpersona` int(11) NOT NULL AUTO_INCREMENT,
  `nombre` varchar(45) DEFAULT NULL,
  `apellido` varchar(45) DEFAULT NULL,
  `cedula` varchar(90) DEFAULT NULL,
  `pass` varchar(45) DEFAULT NULL,
  `edad` varchar(45) DEFAULT NULL,
  `genero` int(11) NOT NULL,
  `estado_civil` int(11) NOT NULL,
  `raza_etnicidad` int(11) NOT NULL,
  `lugar_nacimiento` int(11) NOT NULL,
  `estado` int(11) NOT NULL,
  `correo` varchar(190) NOT NULL,
  `created_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`idpersona`),
  UNIQUE KEY `correo` (`correo`),
  UNIQUE KEY `cedula` (`cedula`),
  KEY `lugar_nacimiento` (`lugar_nacimiento`),
  KEY `estado` (`estado`),
  KEY `raza_etnicidad` (`raza_etnicidad`),
  KEY `estado_civil` (`estado_civil`),
  KEY `genero` (`genero`),
  CONSTRAINT `persona_ibfk_1` FOREIGN KEY (`lugar_nacimiento`) REFERENCES `municipio` (`idmunicipio`),
  CONSTRAINT `persona_ibfk_2` FOREIGN KEY (`estado`) REFERENCES `estados` (`id`),
  CONSTRAINT `persona_ibfk_3` FOREIGN KEY (`raza_etnicidad`) REFERENCES `raza_etnicidad` (`idraza_etnicidad`),
  CONSTRAINT `persona_ibfk_4` FOREIGN KEY (`estado_civil`) REFERENCES `estado_civil` (`idestado_civil`),
  CONSTRAINT `persona_ibfk_5` FOREIGN KEY (`genero`) REFERENCES `genero` (`idgenero`)
) ENGINE=InnoDB AUTO_INCREMENT=1722 DEFAULT CHARSET=latin1;

