  CONSTRAINT `respuestas_ibfk_1` FOREIGN KEY (`posibles_respuesta`) REFERENCES `posibles_respuestas` (`id`),
  CONSTRAINT `respuestas_ibfk_2` FOREIGN KEY (`pregunta`) REFERENCES `preguntas` (`id`),
  CONSTRAINT `respuestas_ibfk_3` FOREIGN KEY (`persona`) REFERENCES `persona` (`cedula`)
