s niveles de bienestar en las siguientes 5 dimensiones','texto inicio','','inherit','closed','closed','','12-revision-v1','','','2018-07-04 00:25:14','2018-07-04 00:25:14','',12,'http://127.0.0.1:8000/web/?p=13',0,'revision','',0),(14,1,'2018-07-04 00:52:53','2018-07-04 00:52:53','La dimensión emocional trata sobre la salud mental. ¿Con qué frecuencia siente emociones positivas y negativas? ¿Siente que es optimista y se siente feliz con la vida, o encuentra que todos los días es una lucha, llena de ansiedad, tristeza, o con otras emociones que le dificultan desempeñarse? La salud Emocional involucra sentirse bien y funcionar bien todos los días, con un sentimiento general de satisfacción con la vida.','EMOCIONAL','','publish','open','open','','emocional','','','2018-07-04 00:52:53','2018-07-04 00:52:53','',0,'http://127.0.0.1:8000/web/?p=14',0,'post','',0),(15,1,'2018-07-04 00:52:42','2018-07-04 00:52:42','','28218789 - good and evil','28218789 - good and evil','inherit','open','closed','','28218789-good-and-evil','','','2018-07-04 00:52:42','2018-07-04 00:52:42','',14,'http://127.0.0.1:8000/web/wp-content/uploads/2018/07/01.jpg',0,'attachment','image/jpeg',0),(16,1,'2018-07-04 00:52:53','2018-07-04 00:52:53','La dimensión emocional trata sobre la salud mental. ¿Con qué frecuencia siente emociones positivas y negativas? ¿Siente que es optimista y se siente feliz con la vida, o encuentra que todos los días es una lucha, llena de ansiedad, tristeza, o con otras emociones que le dificultan desempeñarse? La salud Emocional involucra sentirse bien y funcionar bien todos los días, con un sentimiento general de satisfacción con la vida.','EMOCIONAL','','inherit','closed','closed','','14-revision-v1','','','2018-07-04 00:52:53','2018-07-04 00:52:53','',14,'http://127.0.0.1:8000/web/?p=16',0,'revision','',0),(17,1,'2018-07-04 00:53:46','2018-07-04 00:53:46','¿Tiene el dinero necesario para suplir sus necesidades cotidianas, o encuentra que vive de sueldo en sueldo, escasamente sobreviviendo? La dimensión financiera se refiere al grado en el cual se cuenta con los recursos necesarios para vivir lo que se quiere vivir, y el grado con el cual se está invirtiendo en el porvenir versus tratar de sortear las deudas y tener suficiente dinero para sobrevivir. Ser capaz de suplir las necesidades es un cimiento importante para construir el bienestar.','FINANCIERO','','publish','open','open','','financiero','','','2018-07-04 00:53:46','2018-07-04 00:53:46','',0,'http://127.0.0.1:8000/web/?p=17',1,'post','',0),(18,1,'2018-07-04 00:53:40','2018-07-04 00:53:40','','02','','inherit','open','closed','','02','','','2018-07-04 00:53:40','2018-07-04 00:53:40','',17,'http://127.0.0.1:8000/web/wp-content/uploads/2018/07/02.jpg',0,'attachment','image/jpeg',0),(19,1,'2018-07-04 00:53:46','2018-07-04 00:53:46','¿Tiene el dinero necesario para suplir sus necesidades cotidianas, o encuentra que vive de sueldo en sueldo, escasamente sobreviviendo? La dimensión financiera se refiere al grado en el cual se cuenta con los recursos necesarios para vivir lo que se quiere vivir, y el grado con el cual se está invirtiendo en el porvenir versus tratar de sortear las deudas y tener suficiente dinero para sobrevivir. Ser capaz de suplir las necesidades es un cimiento importante para construir el bienestar.','FINANCIERO','','inherit','closed','closed','','17-revision-v1','','','2018-07-04 00:53:46','2018-07-04 00:53:46','',17,'http://127.0.0.1:8000/web/?p=19',0,'revision','',0),(20,1,'2018-07-04 01:02:14','2018-07-04 01:02:14','La dimensión social se refiere a la calidad de relaciones interpersonales que sostenemos. ¿Se siente cercano(a) a otros o se siente solitario(a), inclusive cuando está rodeado(a) de muchas personas? ¿Tiene quién lo (la) apoye cuando lo necesite? ¿Le brinda usted apoyo a los que lo rodean (la rodean)? No se trata de cuántas personas conoce, sino qué tanto se siente conectado(a) con los demás.','SOCIAL','','publish','open','open','','social','','','2018-07-04 01:02:14','2018-07-04 01:02:14','',0,'http://127.0.0.1:8000/web/?p=20',2,'post','',0),(21,1,'2018-07-04 01:02:03','2018-07-04 01:02:03','','41461594 - group of friends on walk taking selfie in forest','41461594 - group of friends on walk taking selfie in forest','inherit','open','closed','','41461594-group-of-friends-on-walk-taking-selfie-in-forest','','','2018-07-04 01:02:03','2018-07-04 01:02:03','',20,'http://127.0.0.1:8000/web/wp-content/uploads/2018/07/03.jpg',0,'attachment','image/jpeg',0),(22,1,'2018-07-04 01:02:14','2018-07-04 01:02:14','La dimensión social se refiere a la calidad de relaciones interpersonales que sostenemos. ¿Se siente cercano(a) a otros o se siente solitario(a), inclusive cuando está rodeado(a) de muchas personas? ¿Tiene quién lo (la) apoye cuando lo necesite? ¿Le brinda usted apoyo a los que lo rodean (la rodean)? No se trata de cuántas personas conoce, sino qué tanto se siente conectado(a) con los demás.','SOCIAL','','inherit','closed','closed','','20-revision-v1','','','2018-07-04 01:02:14','2018-07-04 01:02:14','',20,'http://127.0.0.1:8000/web/?p=22',0,'revision','',0),(23,1,'2018-07-04 01:02:50','2018-07-04 01:02:50','¿Cómo se siente físicamente? La dimensión física se refiere al estado de la salud – tanto objetiva como subjetivamente. ¿Es por lo general saludable o con frecuencia se enferma? ¿Se siente energético(a), en buen estado físico, y con fuerzas, o siente que lucha para lograr realizar las labores diarias que desea o necesita ejecutar? Gozar de un estado saludable le provee los cimientos para una buena salud mental.','FÍSICO','','publish','open','open','','fisico','','','2018-07-04 01:02:50','2018-07-04 01:02:50','',0,'http://127.0.0.1:8000/web/?p=23',3,'post','',0),(24,1,'2018-07-04 01:02:44','2018-07-04 01:02:44','','04','31243072 - woman runner feet running on the beach at sunrise closeup on shoe. woman fitness sunrise jog workout welness concept. asian','inherit','open','closed','','04','','','2018-07-04 01:02:44