/* Function  structure for function  `fn_tv` */

/*!50003 DROP FUNCTION IF EXISTS `fn_tv` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`xplorate_estudiantes`@`localhost` FUNCTION `fn_tv`(`s_respuestas_historic_1` BIGINT(20), `v_variable` VARCHAR(99), `v_persona` VARCHAR(99)) RETURNS int(11)
BEGIN
	DECLARE s_salida INTEGER(11);
	SELECT MAX(pr.`valor`)
	INTO s_salida
	FROM
	  `subtitulo2` s2,
	  `b_respuestas_historic_2` rh2,
	  `posibles_respuestas` pr
	  WHERE respuestas_historic_1=s_respuestas_historic_1
	   AND  `rh2`.`persona`= v_persona
	   AND `s2`.`pregunta`=`rh2`.`pregunta`
	   AND s2.`variable`=v_variable
	   AND rh2.`posibles_respuesta`=pr.`id`
	   AND rh2.`pregunta`=pr.`pregunta`;
	  IF (s_salida=NULL) THEN
	   SELECT 0
	   INTO s_salida;
	  END IF;
	  RETURN (s_salida);
END */$$
DELIMITER ;

