           ( ( (fn_tv( s_sec, 'ocm11',v_persona)) + (fn_tv( s_sec, 'ocm15',v_persona)) ) + ( 5 - (fn_tv( s_sec, 'ocm12',v_persona)) ) + (5 - (fn_tv( s_sec, 'ocm13',v_persona)) ) + (5 - (fn_tv( s_sec, 'ocm14',v_persona)) ) + (5 - (fn_tv( s_sec, 'ocm16',v_persona)) ) )
          )/6
  INTO    s_Involment;
  
    
  SELECT  (
           ( (fn_tv( s_sec, 'ocm17',v_persona)) + (fn_tv( s_sec, 'ocm18',v_persona)) + (fn_tv( s_sec, 'ocm19',v_persona)) + (fn_tv( s_sec, 'ocm20',v_persona)) + (fn_tv( s_sec, 'ocm21',v_persona)) )
