  SELECT  (
            ( ( (fn_tv( s_sec, 'ocm30',v_persona)) + (fn_tv( s_sec, 'ocm32',v_persona)) ) + ( 5 - (fn_tv( s_sec, 'ocm31',v_persona)) ) + ( 5 - (fn_tv( s_sec, 'ocm33',v_persona)) ) + ( 5 - (fn_tv( s_sec, 'ocm34',v_persona)) ) )
          )/5
  INTO    s_Formalization;
  
    
  SELECT  (
